window.bookSummaryJSON = "<p>The <i>New York Times</i> best-selling author of the Peter and the Starcatcher and Kingdom Keepers series, Ridley Pearson, brings us the stirring digital prequel to the Lock and Key series, which reimagines the origins of the rivalry between Sherlock Holmes and James Moriarty. </p> <p>In <i>The Gadwall Incident</i>, listeners get a glimpse into James' life a mere 24 hours before the tipping point - before life as he knows it changes irrevocably and his childhood slips into the shadows. Listeners will come to know the dangers that surround the Moriartys before James and Moria are sent off to the hallowed halls of Baskerville Academy, where they first meet the insufferable, inexhaustible Sherlock Holmes. It's a tale full of intrigue and false starts and daring getaways, one that will leave listeners desperate to know what's next. </p>"; 
